import React from 'react';
import planeImage from '/Users/mehreenaiman/Documents/GitHub/FlightForesight/API Model Deployment/flight-foresight/src/images/kisspng-airplane-mode-computer-icons-plane-5acdf256b24965.6757273115234463587303.png';

const BackgroundTravelWebsite = () => {
    return (
        <div style={{
            backgroundColor: '#98FF98',
            textAlign: 'left',
            paddingLeft: '20px',
            display: 'flex',            // Use flexbox
            alignItems: 'center',       // Vertically align items in the center
        }}>
            <img 
                src={planeImage} 
                alt="JetSet" 
                style={{
                    width: '60px', 
                    height: 'auto', 
                    paddingTop: '30px', 
                    transform: 'rotate(270deg)',
                    marginRight: '20px'    // Optional: Adds spacing between image and text
                }} 
            />
            <h1 style={{ color: '#000000', fontSize: '70px' }}>jetSet</h1>       
        </div>
    );
};

export default BackgroundTravelWebsite;
